import React from 'react';
import './Navbar.css';
import logo from '../../assets/logo.PNG'; // Assurez-vous que le nom correspond au fichier réel

const Navbar = () => {
   return (
        <nav>
            <div className="navbar-logo">
                <img src={logo} alt="Logo" />
            </div>
            <ul className="navbar-links">
                <li>Faculté</li>
                <li>Départements</li>
                <li>About us</li>
                <li>Campus</li>
                <li>Testimonials</li>
                <li>Contact us</li>
            </ul>
        </nav>
    );
}

export default Navbar;
